let acceptList = [];

export function getAcceptList() {
  return acceptList;
}

export function addAcceptList(favor) {
  acceptList = acceptList.unshift(favor);
}

export function removeAcceptList(favor) {
  acceptList = acceptList.splice(acceptList.indexOf(favor), 1);
}
